class EdmComponent extends React.Component {

  constructor(props) {
    super(props);
    this.state = {row: 0};
  }

  handleClick(e) {
    this.setState({
      row: e.target.id
    });
  }

  displayRows(dataType) {

    var namesList = dataType.map((property) => {
                  return ( <p id={dataType.indexOf(property)} onClick={(e) => this.handleClick(e)}>{property.title}</p> );
                  }
                  );

    return (<div className="feed">{namesList}</div>);
  }

  displayRowDetails(dataType, dataTypeName, rowNumber=0){
    var dataObject = dataType[rowNumber];

    var id = dataObject.id;
    var type = dataObject.type.namespace + "." + dataObject.type.name;
    var title = dataObject.title;
    var description = dataObject.description;
    var dataType = dataObject.datatype;
    var pii =dataObject.piiField;
    var analyzer =dataObject.analyzer;

    return (
      <div>
        <h1>{dataTypeName} Details</h1>
        <h4>ID</h4>
        <p>{id}</p>

        <h4>Type</h4>
        <p>{type}</p>

        <h4>Title</h4>
        <p>{title}</p>

        <h4>Description</h4>
        <p>{description}</p>

        <h4>DataType</h4>
        <p>{dataType}</p>

        <h4>PII</h4>
        <p>{pii}</p>

        <h4>Analyzer</h4>
        <p>{analyzer}</p>
      </div>);

  }


  render () {
    return (
      <div>
        <div>Hello, World! This is Marie!</div>
        <div className="window">
          <div className="left-facing">
            {this.displayRows(dataPropertyType)}
          </div>
          <div className="right-facing">
            {this.displayRowDetails(dataPropertyType, "Property Type", this.state.row)}
          </div>
        </div>
      </div>
      );
  }
}

const AppContainer = (props :Props) => (
  <AppWrapper>
    <AppHeaderOuterWrapper>
      <AppHeaderInnerWrapper>
        <Logo src={OpenLatticeLogo} height="50" />
        <Title>OpenLattice React App</Title>
        <StyledActionButton onClick={props.actions.logout}>Logout</StyledActionButton>
      </AppHeaderInnerWrapper>
    </AppHeaderOuterWrapper>
    <Switch>
      // HERE IS WHERE IT IS ADDED TO THE APP!!!!!!!!!!!!!!!!!!!!
      <Route path={Routes.ROOT} component={EdmComponent} />
      <Redirect to={Routes.ROOT} />
    </Switch>
  </AppWrapper>
);

function mapDispatchToProps(dispatch :Function) :Object {

  return {
    actions: bindActionCreators({ logout }, dispatch)
  };
}

export default connect(null, mapDispatchToProps)(AppContainer);
